import React from "react";

const thumbnailStyle = {
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-evenly",
    flexWrap: wrap,
    alignItems: flex-start,
    width: "100%"
};

export const Thumbnail = ({ ...props }) => (
    <div style={thumbnailStyle}>
        {props.text}
        {props.image}
    </div>
)

export default Thumbnail;
